import './App.css';
import Cards from './components/Cards.jsx';
import Nav from './components/Nav';
import { useState } from 'react';


function App() {

   let [characters, setCharacters] = useState([]);


   return (
      <div className='App'>
         <Cards characters={characters} />
         <Nav/>
      </div>
   );
}

export default App;
